import React from 'react'
import "bootstrap/dist/css/bootstrap.css";

class Login extends React.Component{
    constructor(props){
        super(props)
        this.state= {
            user:"",
            pw:"",
        }
    }

    render(){
        return(
            <div className="row">
                <div class="col-sm-3"></div>
                <div class="col-sm-6">
                    <p>Username</p>
                    <input className="form-control" onChange={this.read} type="text" name="user" value={this.state.user}/><br/><br/>
                </div>    
                <div class="col-sm-3"></div>
                <div class="col-sm-3"></div>
                <div class="col-sm-6">                                
                    <p>Password</p>
                    <input className="form-control" onChange={this.read} type="password" name="pw" value={this.state.pw}/><br/><br/>
                </div>
                <div class="col-sm-5"></div>
                <div class="col-sm-2">                                 
                    <button id="si" type="button" onClick={this.home} className="btn">Sign In</button><br/><br/>
                </div>  
                <div class="col-sm-5"></div>
                <div class="col-sm-5"></div>
                <div class="col-sm-2">
                    <button id="su" type="button" onClick={this.signUp} className="btn btn-link">Sign Up</button>    
                </div>
                <div class="col-sm-5"></div>
            </div>
                        
        )                   
    }
    read = (ele) =>{
    console.log(ele.target.name);
    this.setState({[ele.target.name]:ele.target.value});			
    }

    home = () =>{
        if (this.state.user!=="" && this.state.pw!==""){
            window.open("Home.html","_self")
        } else {
            alert("Username or password is missing")
        }
    }

    signUp =() =>{
        window.open("Signup.html","_self")
    }
}

export default Login

