                            <div class="col-sm-3"></div>
                            <div class="col-sm-6">
                                <p>Date of birth</p>                            
                                <input className="form-control" onChange={this.read} type="date" name="dob" value={this.state.dob}/>
                            </div>
                            <div class="col-sm-3"></div>

                            <div class="col-sm-3"></div>
                            <div class="col-sm-6">
                                <p>Set Username</p>
                                <input className="form-control" onChange={this.read} type="text" name="user" value={this.state.user}/>    
                            </div>
                            <div class="col-sm-3"></div>

                            <div class="col-sm-3"></div>
                            <div class="col-sm-6">
                                <p>Set Password</p>
                                <input className="form-control" onChange={this.read} type="password" name="pw" value={this.state.pw}/>
                            </div>
                            <div class="col-sm-3"></div>
                            
                            <div class="col-sm-5"></div>
                            <div class="col-sm-2">
                                <button className="btn btn-link" onClick={this.signup}>Create account</button>
                            </div>
                            <div class="col-sm-3"></div>
                        </div>
                    )                   
                }
                read = (ele) =>{
				console.log(ele.target.name);
                if (ele.target.value!==""){
				    this.setState({[ele.target.name]:ele.target.value});			
                    }
			    }

                signup = ()=>{
                    if (this.state.fname!=="" && this.state.num!=="" && this.state.dob!=="" && this.state.user!=="" && this.state.pw!==""){
                        if (this.state.num.length == 10){
                            alert("Sign up successful!!")
                            window.open("SignIn.html","_self")
                        } else {
                            alert("Length of phone number should be 10.")
                        }
                    } else {
                        alert("Please fill the details.")
                    }
                }
            }

